export const moveBackArrow = (pagin, page, range) => {
    if(page >= 8 && page < range - 8) {
        let left = pagin.style.marginLeft;
        pagin.style.marginLeft = parseInt(left) + 51 + 'px';
    } 
}

export const moveAheadArrow = (pagin, page, range) => {
    if(page >= 8 && page < range - 8) {
        pagin.style.marginLeft = parseInt(pagin.style.marginLeft) - 51 + 'px';
    } 
}

